import getArticle from "../utils/contentful.js";

const Home = (props) => {
    return (
        <div>
            {props.articles && props.articles.map(article => {
                return (
                    <div>
                        <p>{article.title}</p>
                    </div>
                );
            })}
        </div>
    )
}
Home.getInitialProps = async () => {
    const contentfulArticle = await getArticle("blogPost");
    const article = contentfulArticle.items;
    console.log(article)

    return {
        articles: article
    };
}


export default Home;
